import React, { useState } from 'react';
import axios from 'axios';

const DeleteUser = () => {
  const [formData, setFormData] = useState({
    username: '',
    userId: '', 
    email: '',
    password: ''
  });
  const [userData, setUserData] = useState(null); 

  const handleChange = event => {
    setFormData({
      ...formData,
      [event.target.name]: event.target.value
    });
  };

  const handleSubmit = async event => {
    event.preventDefault();
    try {
      const response = await axios.get(`http://127.0.0.1:8000/users/${formData.userId}`);
      setUserData(response.data); 
    } catch (error) {
      console.error('Error fetching user:', error);
    }};
  const handleDelete = async (userId) => {
    try {
      const response = await axios.delete(`http://127.0.0.1:8000/users/${userId}`);

      if (response.status === 200) {
        console.log('User deleted successfully');
      } else {
        console.log('Failed to delete user');
      }} catch (error) {
      console.error('Error deleting user:', error);}};
  return (
    <div className='main_top'>
      <button className='box_ grey' type="submit"><a href='/createuser'> Back</a></button>
      <h1>Delete User</h1>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="userId">User ID:</label>
          <input
            type="text"
            id="userId"
            name="userId"
            value={formData.userId}
            onChange={handleChange}
          />
        </div>
        <button className='box_ grey' type="submit">Fetch User Info</button>
      </form>

      {userData && ( // Display user data if available
        <div>
          <h2>User Info</h2>
          <div>
            <strong>Username:</strong>{userData.username}
          </div>
          <div>
            <strong>Email:</strong>{userData.email}
          </div>
          <div>
            <strong>Password:</strong>{userData.password}
          </div>
          <button className='box_ grey' onClick={() => handleDelete(userData.id)}>Delete User</button> {/* Move delete button outside the form */}
        </div>
      )}
    </div>
  );
};

export default DeleteUser;
